import './App.css';
import 'antd/dist/antd.css';
import HeaderApp from './components/common/HeaderApp'

import { Layout } from 'antd';

const { Header } = Layout;


function App() {
  return (
    <Layout className="layout">
      <Header>
        <HeaderApp />
      </Header>
    </Layout>
  );
}

export default App;
